import React from 'react'
import './PokemonList.css'

const ListItem = (props) => {


    return (
        <>
            {props.allPokemon.map((pokemon) => {
                return <li onClick={props.handlePokemonClick}>{pokemon.name}</li>
            })}
        </>
    )
}

export default ListItem
